@import '../scss/variables';

.tab {
    padding: 14px 24px;
    background-color: white;

    &:hover {
        cursor: pointer;
        color: var(--uv-color-primary);
        font-weight: bold;
        background-color: $color-gray-light-5;
        box-shadow: inset -4px 0 0 var(--uv-color-primary);
            a, svg, span {
                color: var(--uv-color-primary);
            }
    }
}

.disabled {
    color: $color-gray-light;
    pointer-events: none;
    cursor: not-allowed;
    a, svg, span {
        color: $color-gray-light;
        pointer-events: none;
    }
    &:hover {
        cursor: not-allowed;
        color: $color-gray-light;
        font-weight: none;
        background-color: white;
        box-shadow: none;
        pointer-events: none;
        a, svg, span {
            color: $color-gray-light;
            pointer-events: none;
        }
    }
}

.active {
    color: var(--uv-color-primary);
        font-weight: bold;
        background-color: $color-gray-light-5;
        box-shadow: inset -4px 0 0 var(--uv-color-primary);
            a, svg, span {
                color: var(--uv-color-primary);
            }
}

.position {
    top: 4px;
}

.reorder-mode {
    border-bottom: 1px solid $color-gray-light;
    background-color: white;
    &:hover {
        cursor: move;
        border: 1px solid $color-gray-light;
    }
    &:active:hover{
        border: 1px solid $color-gray-light;
    }
}

.cdk-drag {
    box-sizing: border-box;
    border-radius: 4px;
    box-shadow: 0 5px 5px -3px rgba(0, 0, 0, 0.2),
                0 8px 10px 1px rgba(0, 0, 0, 0.14),
                0 3px 14px 2px rgba(0, 0, 0, 0.12);
}

